window.bookSummaryJSON = "<p><b>Transported to a new part of the map? Things are about to go sideways.</b></p> <p>Illume thought the madness was over. He was wrong. When his beauty sleep is interrupted and he's dropped in god knows where someone's got to pay.</p> <p>A new adventure begins as more of the world is explored and evil takes on a different, more intelligent face.</p> <p>Along the way, Illume will work with Nari to uncover her memory. The two might just have a chance if they stand as one, fight together and keep their eye on the prize.</p> <p>Jump into the next installment of the best-selling series Legends Online and see what all the hype is about. Listen now!</p>"; 
